import { Outlet, Link } from "react-router-dom";


const Layout = () => {
  return (
    <>
      <nav>
        <ul>
            <li>
                <Link to="/">Home</Link>
            </li>
            <li>
                <Link to="/jiaxin">Information page</Link>
            </li>
            <li>
                <Link to="/nigel">Calling API</Link>
            </li>
        </ul>
      </nav>
      <Outlet />
    </>
  )
};

export default Layout;
